<!doctype html>
<html lang="en-NZ">
<head>
  <meta charset="utf-8" />
  <meta name="viewport" content="width=device-width,initial-scale=1" />
  <title>Pak'nSave Tools Hub</title>
  <style>
    :root {
      color-scheme: dark;
      --bg: #0b0f14;
      --panel: rgba(255,255,255,0.04);
      --line: rgba(255,255,255,0.14);
      --text: #e7eef8;
      --muted: rgba(231,238,248,0.72);
      --accent: rgba(64,142,255,0.35);
      --radius: 14px;
      --sans: system-ui, -apple-system, Segoe UI, Roboto, Ubuntu, Cantarell, Noto Sans, Helvetica, Arial;
    }
    * { box-sizing: border-box; }
    html, body { height: 100%; margin: 0; background: var(--bg); color: var(--text); font-family: var(--sans); }
    header {
      position: sticky;
      top: 0;
      z-index: 10;
      padding: 10px 12px;
      border-bottom: 1px solid var(--line);
      background: linear-gradient(180deg, rgba(255,255,255,0.05), rgba(255,255,255,0.00));
      backdrop-filter: blur(8px);
    }
    .row {
      display: flex;
      align-items: center;
      justify-content: space-between;
      gap: 10px;
      flex-wrap: wrap;
    }
    h1 {
      margin: 0;
      font-size: 14px;
      font-weight: 900;
      letter-spacing: 0.2px;
      display: flex;
      align-items: center;
      gap: 10px;
      flex-wrap: wrap;
    }
    .pill {
      display: inline-flex;
      align-items: center;
      gap: 8px;
      padding: 4px 10px;
      border-radius: 999px;
      border: 1px solid var(--line);
      background: rgba(255,255,255,0.03);
      font-size: 12px;
      color: var(--muted);
      font-weight: 800;
      white-space: nowrap;
    }
    .tabs {
      display: flex;
      gap: 8px;
      align-items: center;
      flex-wrap: wrap;
    }
    button {
      border: 1px solid var(--line);
      background: rgba(255,255,255,0.06);
      color: var(--text);
      padding: 9px 12px;
      border-radius: 999px;
      cursor: pointer;
      font-weight: 900;
      font-size: 12px;
      white-space: nowrap;
    }
    button:hover { background: rgba(255,255,255,0.09); }
    button.active {
      border-color: rgba(64,142,255,0.55);
      background: rgba(64,142,255,0.18);
    }
    .hint {
      margin-top: 8px;
      font-size: 12px;
      color: var(--muted);
      line-height: 1.35;
    }
    .wrap {
      height: calc(100vh - 74px);
      padding: 10px;
    }
    .frame {
      width: 100%;
      height: 100%;
      border: 1px solid var(--line);
      border-radius: var(--radius);
      background: rgba(255,255,255,0.02);
    }
    .hidden { display: none; }
    @media (max-width: 800px) {
      .wrap { height: calc(100vh - 92px); }
    }
  </style>
</head>
<body>
<header>
  <div class="row">
    <h1>

      <span class="pill" id="activePill">Product Explorer</span>
      <span class="pill">Generated 2026-01-25 06:11:47 UTC</span>
    </h1>
    <div class="tabs">
      <button id="tabExplorer" class="active" type="button">Product Explorer</button>
      <button id="tabAnalyzer" type="button">Timeline Analyzer</button>
      <button id="btnReload" type="button" title="Reload the active tool frame">Reload Active</button>
    </div>
  </div>
  <div class="hint">
    Tabs are isolated in iframes so their scripts and styles do not clash. Tokens and session storage are managed inside each tool tab.
  </div>
</header>

<div class="wrap">
  <iframe id="frameExplorer" class="frame" referrerpolicy="no-referrer"></iframe>
  <iframe id="frameAnalyzer" class="frame hidden" referrerpolicy="no-referrer"></iframe>
</div>

  const elExplorerBtn = document.getElementById('tabExplorer');
  const elAnalyzerBtn = document.getElementById('tabAnalyzer');
  const elReloadBtn = document.getElementById('btnReload');
  const elPill = document.getElementById('activePill');

  const frameExplorer = document.getElementById('frameExplorer');
  const frameAnalyzer = document.getElementById('frameAnalyzer');

  let loadedExplorer = false;
  let loadedAnalyzer = false;
  let active = 'explorer';

  function loadExplorer() {
    if (loadedExplorer) return;
    frameExplorer.src = 'data:text/html;base64,' + B64_EXPLORER;
    loadedExplorer = true;
  }

  function loadAnalyzer() {
    if (loadedAnalyzer) return;
    frameAnalyzer.src = 'data:text/html;base64,' + B64_ANALYZER;
    loadedAnalyzer = true;
  }

  function setActive(which) {
    active = which;
    if (which === 'explorer') {
      loadExplorer();
      frameExplorer.classList.remove('hidden');
      frameAnalyzer.classList.add('hidden');
      elExplorerBtn.classList.add('active');
      elAnalyzerBtn.classList.remove('active');
      elPill.textContent = 'Product Explorer';
    } else {
      loadAnalyzer();
      frameAnalyzer.classList.remove('hidden');
      frameExplorer.classList.add('hidden');
      elAnalyzerBtn.classList.add('active');
      elExplorerBtn.classList.remove('active');
      elPill.textContent = 'Timeline Analyzer';
    }
  }

  function reloadActive() {
    if (active === 'explorer') {
      if (!loadedExplorer) loadExplorer();
      else {
        frameExplorer.src = frameExplorer.src;
      }
    } else {
      if (!loadedAnalyzer) loadAnalyzer();
      else {
        frameAnalyzer.src = frameAnalyzer.src;
      }
    }
  }

  elExplorerBtn.addEventListener('click', () => setActive('explorer'));
  elAnalyzerBtn.addEventListener('click', () => setActive('analyzer'));
  elReloadBtn.addEventListener('click', reloadActive);

  // Load the default tab
  loadExplorer();
</script>
</body>
